import React from "react";
class Classes extends React.Component {

    render() {
        return (

            <div>
                <h3>5 eme</h3>
                <h3>4 eme</h3>
                <h3>3 eme</h3>
                <h3>Seconde</h3>
                <h4>Premiere</h4>
                <h5>Terminale</h5>
                <h2>Bac+1</h2>
                <h2>Bac+2</h2>
            </div>
        )
    }


}

export default Classes;
